<script>
    A=[7,2,5,3,5,3];
    B=[7,2,5,4,6,3,5,3];
    for(i=0;i<A.length;i++){
        for(j=0;j<B.length;j++){
            if(A[i]==B[j]){
                B.splice(j, 1);
            }
        }
    }
    B.sort();
    for(i=0;i<A.length;i++){
        for(j=i+1;j<B.length;j++){
            if(B[i]==B[j]){
                B.splice(j, 1);
                j--;
            }
        }
    }
    document.write("missingValue(A, B) = [ "+B.join(" , ")+" ]");
</script>
